import React from 'react'
import classes from './Classes.module.css'
import firstPic from '../../assets/footer-gallery-thumb-6.jpg';
import secondPic from '../../assets/trainer-6.jpg';
import thirdPic from '../../assets/trainer-7.jpg'

const Classes = () => {
  return (
    <div className={classes.classes}>
      <div className={classes.sideBar}>
        <h3>OTHER SECTIONS</h3>
        <div className={classes.images}>
          <div>FITNESS</div>
          <div>CROSSFIT</div>
          <div>CARDIO</div>
        </div>
      </div>
      <div className={classes.mainBar}></div>
    </div>
  )
}

export default Classes;
